var input = document.getElementById('loc-input');
var autocomplete, geocoder;

function initialize() {
// Create the autocomplete object, restricting the search
// to geographical location types.
    autocomplete = new google.maps.places.Autocomplete(
        /** @type {HTMLInputElement} */(document.getElementById('autocomplete')),
        { types: ['geocode'] });
    geocoder = new google.maps.Geocoder();
    loadCSV();
}

var studentData = {};
var locations = {};

function parseAddress(addressComponents) {
    var country = addressComponents[addressComponents.length - 1].long_name;
    var province = addressComponents.length > 2 ? addressComponents[addressComponents.length - 2].long_name : null;
    var city = addressComponents.length > 1 ? addressComponents[0].long_name : null;
    return {'country': country, 'province': province, 'city': city};
}

function saveStudentData(firstName, lastName, location) {
    geocoder.geocode( {'address': location}, function (results, status) {
        var locationData;
        if (status == google.maps.GeocoderStatus.OK) {
            locationData = parseAddress(results[0].address_components);
            console.log(locationData);
            // This wouldn't be a problem if working at larger scale
            var student = [lastName, firstName];
            var country = locationData['country'];
            var province = locationData['province'];
            var city = locationData['city'];
            studentData[student] = locationData;
            if (country in locations) {
                if ('students' in locations[country]) {
                    locations[country]['students'].push(student);
                } else {
                    locations[country]['students'] = [student];
                }
            } else {
                locations[country] = {'students': [student]};
            }
            if (province) {
                if ('province' in locations[country]) {
                    if (province in locations[country]['province']) {
                        locations[country]['province'][province].push(student);
                    } else {
                        locations[country]['province'][province] = [student];
                    }
                } else {
                    locations[country]['province'] = {province: [student]};
                }
            }
            if (city) {
                if ('cities' in locations[country]) {
                    if (city in locations[country]['cities']) {
                        locations[country]['cities'][city].push(student);
                    } else {
                        locations[country]['cities'][city] = [student];
                    }
                } else {
                    locations[country]['cities'] = {};
                    locations[country]['cities'][city] = [student];
                }

            }
        } else
        //This was removed because it took too long to load the queries
        if (status == google.maps.GeocoderStatus.OVER_QUERY_LIMIT) {
            // setTimeout(function() {saveStudentData(firstName, lastName, location)}, 1);
        }
    });
}

function loadCSV() {
    var lines = fileContent.split("\n");
    //knowing that file is in format [first name, last name, location]
    for (var student = 0; student < lines.length; student++) {
        var data = lines[student].split(',');
        if (data.length >= 3) {
            var location = data[2];
            if (data.length > 3) {
                for (var i = 3; i < data.length; i++) {
                    location += (',' + data[i]);
                }
            }
            saveStudentData(data[0], data[1], location);
        }
    }
}

function retrieveStudents(locationData) {
    var country = locationData['country'];
    var province = locationData['province'];
    var city = locationData['city'];
    if (country && !city) {
        return locations[country] ? locations[country]['students'] : null;
    } else
    if (country && city) {
        return locations[country]['cities'] ? locations[country]['cities'][city] : null;
    } else {
        return null;
    }
}

// Bias the autocomplete object to the user's geographical location,
// as supplied by the browser's 'navigator.geolocation' object.
function geolocate() {
    if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(function(position) {
            var geolocation = new google.maps.LatLng(
                position.coords.latitude, position.coords.longitude);
            var circle = new google.maps.Circle({
              center: geolocation,
              radius: position.coords.accuracy
            });
            autocomplete.setBounds(circle.getBounds());
        });
    }
}

function stringifyLocation(location) {
    var locationStr = location['country'];
    if (location['province']) {
        locationStr += ", " + location['province'];
    }
    if (location['city']) {
        locationStr += ", " + location['city'];
    }
    return locationStr;
}

function updatePage(students) {
    var oldTable = document.getElementById("results");
    var newTable = oldTable.cloneNode(true);
    while (newTable.firstChild) {
        newTable.removeChild(newTable.firstChild);
    }
    if (students != null) {
        for (var i = 0; i < students.length; i++){
            var studentLocation = studentData[students[i]];
            var tr = document.createElement('tr');
            var firstName = document.createElement('td');
            firstName.appendChild(document.createTextNode(students[i][1]));
            var lastName = document.createElement('td');
            lastName.appendChild(document.createTextNode(students[i][0]));
            var location = document.createElement('td');
            location.appendChild(document.createTextNode(stringifyLocation(studentLocation)));
            tr.appendChild(firstName);
            tr.appendChild(lastName);
            tr.appendChild(location);
            newTable.appendChild(tr);
        }
    } else {
        var tr = document.createElement('tr');
        var td = document.createElement('td');
        td.appendChild(document.createTextNode('No results found'));
        tr.appendChild(td);
        newTable.appendChild(tr);
    }

    oldTable.parentNode.replaceChild(newTable, oldTable);
}

function search(input) {
    var location = input.value;
    if (event.keyCode == 13) { //if enter is pressed
        geocoder.geocode( {'address': location}, function (results, status) {
            if (status == google.maps.GeocoderStatus.OK) {
                var locationData = parseAddress(results[0].address_components);
                var students = retrieveStudents(locationData);
                updatePage(students);
            }
        });
    }
}